      className="appImage"
      src={
        "https://cdn0.iconfinder.com/data/icons/startup-and-new-business-3/24/target-512.png"
      }
      alt={"aim game"}
      id={"aim"}
    ></img>
  </div>

  </section>

)

export default withRouter(Home);
